import React from 'react';

function deklareraVinnare(play, data) {
    let winner = '';
    if (play === data ) {
        winner = 'Lika';

    }else if (play > data){
        winner = 'Play Vann!!';
    }else{
        winner = 'Data Vann!! BUUU'
    }
    return winner;
}

function ShowVinnare(props) {
    const vinn = deklareraVinnare (props.play, props.data);

    return
        <section>
            <p>{ vinn }</p>
        </section>

}

export default ShowVinnare;
